import React, {Component} from 'react';
import MandalArtTable from "./MandalArtTable";
import '../css/MandalArtTemplate.css';

class MandalArtTemplate extends Component {
    constructor(props) {
        super(props);
        this.state = {
            MandalArtData: [
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9],
                [1,2,3,4,5,6,7,8,9]
                // [
                //     {aa: '1'},
                //     {ab: '2'},
                //     {ac: '3'},
                //     {ba: '4'},
                //     {bb: '5'},
                //     {bc: '6'},
                //     {ca: '7'},
                //     {cb: '8'},
                //     {cc: '9'}
                // ],
            ]
        };
    }

    render() {
        return (
            <section className="section">
                {/*<div className="title">만다라트</div>*/}
                <div className="grid outer-grid justify-between">
                    {this.state.MandalArtData.map((data, idx) => {
                        console.log('템플릿'+this.state.MandalArtData);
                        return (
                            <MandalArtTable key={idx} data={data}/>
                        );
                    })}
                </div>
            </section>
        )
    }
}

export default MandalArtTemplate;
